import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <DragableDiv></DragableDiv>
      </header>
    </div>
  );
}

function DragableDiv(content) {
  return (
    <div id="dragable_div">
      <div id="mydivheader">{content.value}</div>
    </div>
  )
}

export default App;
